import styled from 'styled-components'
import TableHead from '../Userlists/TableHead'
import TableBody from '../Userlists/TableBody'
import Navbar from '../Header/Navbar'
import LeftSidebar from '../LeftSidebar/LeftSidebar'
import { useDisptach, useSelector } from 'react-redux';
import { useEffect } from 'react'
import { userlistInitiate } from '../../Actions/menuAction'

const Userlist = () =>{
   const dispatch = useDisptach();
   const {userlist} = useSelector(state=>state.menu)
   useEffect(()=>{
        dispatch(userlistInitiate())
   },[])
    return(
        <>
            <Navbar/>
            <Container>
                <LeftSidebar/>
                <Table>
                    <TableHead/>
                    <TableBody/>
                </Table>
            </Container>
        </>
    )
}
const Table = styled.div`

`
const Container = styled.div `

    display:flex;
`
export default Userlist
